import React from 'react';
import { HeaderStyled } from './Header.style';

const Header = () => {
  return (
    <HeaderStyled>
      <nav>
        <ul>
          <li>Admin</li>
          <li>Posts</li>
        </ul>
      </nav>
    </HeaderStyled>
  );
}

export { Header };
